ovingAverage(self.datas[0], period=8, plotname='EMA_8')\n#         bt.indicators.ExponentialMovingAverage(self.datas[0], period=14, plotname='EMA_14')\n\n        self.lines.rf = MyRFIndicator(self.data, path_model=self.p.path_model, m=self.p.m)\n\n        self.ahead_time = 8\n        self.timeIni = None \n#         self.order = None\n\n    def notify_order(self, order):\n        ''' \u00bfPor qu\u00e9 usar notify_order?\n        Porque esto asegura que la orden que debe ser controlada por el Stop realmente se ha ejecutado. Esto puede no ser un gran problema \n        durante las pruebas de backtesting, pero lo es cuando se opera en vivo.   \n        ''' \n        if not order.status == order.Completed:\n            return  # discard any other notification\n\n        if not self.position:  # we left the market\n            print('SELL@price: {:.2f}'.format(order.executed.price))\n            return\n\n        # We have entered the market\n        print('BUY @price: {:.2f}'.format(order.executed.price))\n\n\n\n    def next(self):       \n        if not self.position:  # not in the market\n            self.timeIni = len(self.data)\n\n            if self.lines.rf[0] == 1:                 \n                size = int(self.broker.get_cash() / self.data)\n                self.buy(size=size)\n                # Stop trail       \n#                 self.buy(size=size, exectype=self.p.stoptype, trailpercent=self.p.trailpercent)\n#                 self.sell(size=size, exectype=self.p.stoptype, trailpercent=self.p.trailpercent)\n\n            # print('COMPRO!')                \n            elif self.lines.rf[0] == 0:\n                size = int(self.broker.get_cash() / self.data)\n                self.sell(size=size)\n#                 self.sell(size=size, exectype=self.p.stoptype, trailpercent=self.p.trailpercent)\n                # Stop trail       \n#                 self.buy(size=size, exectype=self.p.stoptype, trailpercent=self.p.trailpercent)\n\n#                 print('VENDO!')                        \n        elif self.position:  # in the market\n            if len(self.data) &amp;gt; self.timeIni + self.ahead_time:\n                self.close()  # close long position\n\n&lt;/code&gt;&lt;/pre&gt;\n\n&lt;hr /&gt;\n\n&lt;h1&gt;Data Feeds&lt;/h1&gt;\n\n&lt;h2&gt;PandasData&lt;/h2&gt;\n\n&lt;table class=\"metaDataTable\"&gt;\n&lt;thead&gt;\n&lt;tr&gt;\n  &lt;th&gt;Property&lt;/th&gt;\n  &lt;th&gt;Value&lt;/th&gt;\n&lt;/tr&gt;\n&lt;/thead&gt;\n&lt;tbody&gt;\n&lt;tr&gt;\n  &lt;td&gt;DataName:&lt;/td&gt;\n  &lt;td&gt;Open     High      Low    Close  Adj CLose  Volume&lt;/td&gt;\n&lt;/tr&gt;\n&lt;/tbody&gt;\n&lt;/table&gt;\n\n&lt;p&gt;Date &lt;br /&gt;\n2018-01-02 00:00:00  1.20088  1.20153  1.20007  1.20135        399       0\n2018-01-02 01:00:00  1.20118  1.20145  1.20045  1.20098       1674       0\n2018-01-02 02:00:00  1.20087  1.20159  1.20083  1.20152        638       0\n2018-01-02 03:00:00  1.20151  1.20223  1.20136  1.20146       1194       0\n2018-01-02 04:00:00  1.20152  1.20154  1.20069  1.20087        942       0\n...                      ...      ...      ...      ...        ...     ...\n2018-06-29 19:00:00  1.16768  1.16820  1.16730  1.16768       4733       0\n2018-06-29 20:00:00  1.16769  1.16824  1.16709  1.16781       3463       0\n2018-06-29 21:00:00  1.16782  1.16815  1.16667  1.16684       2702       0\n2018-06-29 22:00:00  1.16684  1.16791  1.16638  1.16773       2718       0\n2018-06-29 23:00:00  1.16771  1.16903  1.16758  1.16831       1995       0&lt;/p&gt;\n\n&lt;p&gt;[3094 rows x 6 columns]|\n|Timezone:|None|\n|Number of bars:|3094|\n|Bar Length:|1 Day|&lt;/p&gt;\n\n&lt;hr /&gt;\n\n&lt;h1&gt;Observers&lt;/h1&gt;\n\n&lt;h2&gt;Broker&lt;/h2&gt;\n\n&lt;table class=\"metaDataTable\"&gt;\n&lt;thead&gt;\n&lt;tr&gt;\n  &lt;th&gt;Parameter&lt;/th&gt;\n  &lt;th&gt;Value&lt;/th&gt;\n&lt;/tr&gt;\n&lt;/thead&gt;\n&lt;tbody&gt;\n&lt;tr&gt;\n  &lt;td&gt;fund&lt;/td&gt;\n  &lt;td&gt;None&lt;/td&gt;\n&lt;/tr&gt;\n&lt;/tbody&gt;\
